import { IRoute } from '@common/interfaces/route.interface';
import { comparePath } from './compare-path.util';

export const findRoute = (routes: IRoute[], path: string): IRoute | undefined => {
    const res = routes.find((r) => {
        return comparePath(r.path.toString(), path);
    });
    return res;
};
